cim:FunctionDescriptor.cim:FunctionDescriptor.initialConditions:
Real xu10 (start =  u1);
Real xu20 (start =  u2);
Real xuab0 (start =  uab);
Real xubc0 (start =  ubc);
Real xuca0 (start =  uca);
Real xi1P_ref_slow (start =  i1P_ref);
Real xi1Q_ref_slow (start =  i1Q_ref);
Real xi2P_ref_slow (start =  i2P_ref);
Real xi2Q_ref_slow (start =  i2Q_ref);
Boolean fault_detected (start = 0);
Boolean UVRT (start = 0);
Boolean OVRT (start = 0);
Boolean FRT_active (start = 0);
Real i1P_ref (start =  i1P_frt_ref);
Real i1Q_ref (start =  Selfix(Mode_cont, 0.0, i1Q_frt_ref));
Real u1_ref (start =  Selfix(Mode_cont, i1Q_frt_ref/Kv+u1, 1.0));
Real i2P_ref (start =  i2P_frt_ref);
Real i2Q_ref (start =  i2Q_frt_ref);
Real i2P_frt_ref;
if noEvent(abs(i2P_frt_ref))) < 1e-6 then
    i2P_frt_ref = 0;
end if;
Real i2Q_frt_ref;
if noEvent(abs(i2Q_frt_ref))) < 1e-6 then
    i2Q_frt_ref = 0;
end if;
Real u2;
if noEvent(abs(u2))) < 1e-6 then
    u2 = 0;
end if;
Real uab;
if noEvent(abs(uab))) < 1e-6 then
    uab =  u1;
end if;
Real ubc;
if noEvent(abs(ubc))) < 1e-6 then
    ubc =  u1;
end if;
Real uca;
if noEvent(abs(uca))) < 1e-6 then
    uca =  u1;
end if;

cim:FunctionDescriptor.cim:FunctionDescriptor.equation:
model FRT_iQ_Freeze_Steady-State

equation
	// Positive sequence

	u1min_iQ = Picdro(((u1min-0.000001)-max(0.0,u1))+0.5, 0.0, 0.0);

	// Freeze input signal in case of FRT, PT1 for a slower signal to freeze
	der(xi1Q_ref_slow) = Select(FRT_active, 0.0, Selfix(Tipre>0, (i1Q_ref-xi1Q_ref_slow)/Tipre, 0));
	i1Q_ref_slow   = xi1Q_ref_slow;
	i1Q_ref_freeze = Select(FRT_active, r(i1Q_ref_freeze), Selfix(Tipre>0, i1Q_ref_slow, i1Q_ref));

	// Output signal depends on FRT settings
	i1Q_frt_ref = Selfix(Mode_cont, Select(u1min_iQ, 0.0, i1Q_uac_ref), Select(FRT_active, Select(u1min_iQ, 0.0, Selfix(iQ_red, 0.0, i1Q_ref_freeze + Delta_i1Q)), i1Q_ref));

	// Negative sequence
	// Freeze input signal in case of FRT, PT1 for a slower signal to freeze
	der(xi2Q_ref_slow) = Selfix(Balanced(), 0.0, Select(FRT_active, 0.0, Selfix(Tipre>0, (i2Q_ref-xi2Q_ref_slow)/Tipre, 0)));
	i2Q_ref_slow   = Selfix(Balanced(), 0.0, xi2Q_ref_slow);
	i2Q_ref_freeze = Selfix(Balanced(), 0.0, Select(FRT_active, pre(i2Q_ref_freeze), Selfix(Tipre>0, i2Q_ref_slow, i2Q_ref)));
	// Output signal depends on FRT settings
	i2Q_frt_ref = Selfix(Balanced(), 0.0, Selfix(Mode_cont, Select(u1min_iQ, 0.0, i2Q_ref), Select(FRT_active, Select(u1min_iQ, 0.0, Selfix(iQ_red, 0.0, i2Q_ref_freeze + Delta_i2Q)), i2Q_ref)));

end FRT_iQ_Freeze_Steady-State;

function Picdro
	input Boolean boolexpr;
	input Real Tpick;
	input Real Tdrop;
	output Boolean varA;
algorithm
	if boolexpr = true then
		varA = delay(1,Tpick);
	else if boolexpr = false then
		varA = delay(0,Tdrop);
	else
		varA = pre(varA)
	end if;
end Picdro;

function Select
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real varA;
algorithm
	if boolexpr then
		varA = x;
	else
		varA = y;
	end if;
end Select;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

function Balanced
	parameter Integer domainType (start=1);
	output Boolean yo;
algorithm
	domainType = 1; // 1 for Balanced RMS, 2 for unBalanced RMS, 3 for EMT simulation
	if domainType = 1 then
		yo = True;
	else
		yo = False;
	end if;
end Balanced;

model FRT_iP_Reduction

equation
	// Positive sequence
	u1min_iP = Picdro(((u1min-0.000001)-max(0.0,u1))+0.5, 0.0, 0.0);
	// Freeze input signal in case of UVRT, PT1 for a slower signal to freeze
	der(xi1P_ref_slow) = Select(UVRT, 0.0, Selfix(Tipre>0, (i1P_ref-xi1P_ref_slow)/Tipre, 0.0));
	i1P_ref_slow   = xi1P_ref_slow;
	i1P_ref_freeze = Select(UVRT, pre(i1P_ref_freeze), Selfix(Tipre>0, i1P_ref_slow, i1P_ref));
	// Output signal depends on FRT settings
	i1P_frt_ref = Select(UVRT, Select(u1min_iP, 0.0, Selfix(iP_red>1.5, Selfix(iP_red_frz,i1P_ref_freeze,i1P_ref)*(1.0-max(0.0,min(1.0,KiPred*Selfix(db_abs,(1.0+u_db_low-u1)/(1.0+u_db_low),(u10+u_db_low-u1)/(u10+u_db_low))))), Selfix(iP_red, 0.0, i1P_ref))), i1P_ref);
	// Negative sequence
	// Freeze input signal in case of UVRT, PT1 for a slower signal to freeze
	der(xi2P_ref_slow) = Selfix(Balanced(), 0.0, Select(UVRT, 0, Selfix(Tipre>0, (i2P_ref-xi2P_ref_slow)/Tipre, 0)));
	i2P_ref_slow   = Selfix(Balanced(), 0.0, xi2P_ref_slow);
	i2P_ref_freeze = Selfix(Balanced(), 0.0, Select(UVRT, pre(i2P_ref_freeze), Selfix(Tipre>0, i2P_ref_slow, i2P_ref)));
	// Output signal depends on FRT settings
	i2P_frt_ref = Selfix(Balanced(), 0.0, Selfix(Mode_cont, Select(u1min_iP, 0.0, i2P_ref), Select(UVRT, Select(u1min_iP, 0.0, Selfix(iP_red>1.5, Selfix(iP_red_frz,i2P_ref_freeze,i2P_ref)*u1/u10, Selfix(iP_red, 0.0, i2P_ref))), i2P_ref)));

	// Parameter "iQ_red" is not used in this block, but listed just for more beautiful order of parameters in parameter list of ElmDsl.

end FRT_iP_Reduction;

