model FRT_Additional_i2Q

equation
	Delta_u2 = Selfix(Balanced(), 0, Selfix(diroot>1.5, u2-0.0, Selfix(diroot>0.5, Selfix(db_abs, Select(u2<(0.0+u_db_low),u2-(0.0+u_db_low),Select(u2>(0.0+u_db_up),u2-(0.0+u_db_up),0)), Select(u2<(u20+u_db_low),u2-(u20+u_db_low),Select(u2>(u20+u_db_up),u2-(u20+u_db_up),0))), u2-u20)));
	Delta_i2Q = Selfix(Balanced(), 0, -Delta_u2*K2);

end FRT_Additional_i2Q;

