model FRT_Additional_i1Q

equation
	// Voltage deviation
	Delta_u1 = Selfix(diroot>2.5, u1-u1fix, Selfix(diroot>1.5, u1-1.0, Selfix(diroot>0.5, Selfix(db_abs>1.5, Select(u1<(u1fix+u_db_low),u1-(u1fix+u_db_low),Select(u1>(u1fix+u_db_up),u1-(u1fix+u_db_up),0)), Selfix(db_abs, Select(u1<(1.0+u_db_low),u1-(1.0+u_db_low),Select(u1>(1.0+u_db_up),u1-(1.0+u_db_up),0)), Select(u1<(u10+u_db_low),u1-(u10+u_db_low),Select(u1>(u10+u_db_up),u1-(u10+u_db_up),0)))), u1-u10)));
	Delta_i1Q = -Delta_u1*K1;

end FRT_Additional_i1Q;

