model FRT_Fault_Detection

equation
	UV1  = Selfix(db_abs>1.5, ((u1fix+u_db_low)-u1) +0.5, Selfix(db_abs, ((1.0+u_db_low)-u1) +0.5, ((u10 +u_db_low)-u1) +0.5));
	UVab = Selfix(db_abs>1.5, ((u1fix+u_db_low)-uab)+0.5, Selfix(db_abs, ((1.0+u_db_low)-uab)+0.5, ((uab0+u_db_low)-uab)+0.5));
	UVbc = Selfix(db_abs>1.5, ((u1fix+u_db_low)-ubc)+0.5, Selfix(db_abs, ((1.0+u_db_low)-ubc)+0.5, ((ubc0+u_db_low)-ubc)+0.5));
	UVca = Selfix(db_abs>1.5, ((u1fix+u_db_low)-uca)+0.5, Selfix(db_abs, ((1.0+u_db_low)-uca)+0.5, ((uca0+u_db_low)-uca)+0.5));
	OV1  = Selfix(db_abs>1.5, (u1 -(u1fix+u_db_up))+0.5, Selfix(db_abs, (u1 -(1.0+u_db_up))+0.5, (u1 -(u10 +u_db_up))+0.5));
	OVab = Selfix(db_abs>1.5, (uab-(u1fix+u_db_up))+0.5, Selfix(db_abs, (uab-(1.0+u_db_up))+0.5, (uab-(uab0+u_db_up))+0.5));
	OVbc = Selfix(db_abs>1.5, (ubc-(u1fix+u_db_up))+0.5, Selfix(db_abs, (ubc-(1.0+u_db_up))+0.5, (ubc-(ubc0+u_db_up))+0.5));
	OVca = Selfix(db_abs>1.5, (uca-(u1fix+u_db_up))+0.5, Selfix(db_abs, (uca-(1.0+u_db_up))+0.5, (uca-(uca0+u_db_up))+0.5));
	fault_UV1  = Picdro(UV1,0.001,0.001);
	fault_UVab = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,UVab),0.001,0.001));
	fault_UVbc = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,UVbc),0.001,0.001));
	fault_UVca = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,UVca),0.001,0.001));
	fault_OV1  = Picdro(OV1,0.001,0.001);
	fault_OVab = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,OVab),0.001,0.001));
	fault_OVbc = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,OVbc),0.001,0.001));
	fault_OVca = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,OVca),0.001,0.001));
	fault_UV = fault_UV1 + fault_UVab + fault_UVbc + fault_UVca;
	fault_OV = fault_OV1 + fault_OVab + fault_OVbc + fault_OVca;
	fault_detected = Select(fault_UV or fault_OV, 1, 0);
	UVRT = fault_UV;
	OVRT = fault_OV
	frt_UV1  = Picdro(UV1,0.001, Selfix(Tpost>0.001,Tpost,0.001));
	frt_UVab = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,UVab),0.001,Selfix(Tpost>0.001,Tpost,0.001)));
	frt_UVbc = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,UVbc),0.001,Selfix(Tpost>0.001,Tpost,0.001)));
	frt_UVca = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,UVca),0.001,Selfix(Tpost>0.001,Tpost,0.001)));
	frt_OV1  = Picdro(OV1,0.001,Selfix(Tpost>0.001,Tpost,0.001));
	frt_OVab = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,OVab),0.001,Selfix(Tpost>0.001,Tpost,0.001)));
	frt_OVbc = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,OVbc),0.001,Selfix(Tpost>0.001,Tpost,0.001)));
	frt_OVca = Selfix(Balanced(), 0, Picdro(Selfix(Balanced(),0,OVca),0.001,Selfix(Tpost>0.001,Tpost,0.001)));
	frt_UV = frt_UV1 + frt_UVab + frt_UVbc + frt_UVca;
	frt_OV = frt_OV1 + frt_OVab + frt_OVbc + frt_OVca;
	FRT_active = Select(frt_UV or frt_OV, 1, 0);

end FRT_Fault_Detection;

