model FRT_Pre-Fault_Voltage

equation
	//Slow PT1 tracking of the voltage (normal operation)
	der(xu10) = Selfix(Tupre>0, Select(fault_detected, 0.0, (u1-xu10)/Tupre), 0.0);
	der(xu20) = Selfix(Balanced(), 0.0, Selfix(Tupre>0, Select(fault_detected, 0.0, (u2-xu20)/Tupre),0));
	der(xuab0) = Selfix(Balanced(), 0.0, Selfix(Tupre>0, Select(fault_detected, 0.0, (uab-xuab0)/Tupre), 0.0));
	der(xubc0) = Selfix(Balanced(), 0.0, Selfix(Tupre>0, Select(fault_detected, 0.0, (ubc-xubc0)/Tupre), 0.0));
	der(xuca0) = Selfix(Balanced(), 0.0, Selfix(Tupre>0, Select(fault_detected, 0.0, (uca-xuca0)/Tupre), 0.0));
	u10 = xu10;
	u20 = xu20;
	uab0 = xuab0;
	ubc0 = xubc0;
	uca0 = xuca0;
	i2Q_frt_ref = Selfix(Balanced(), 0.0, Selfix(Mode_cont, Select(u1min_iQ, 0.0, i2Q_ref), Select(FRT_active, Select(u1min_iQ, 0.0, Selfix(iQ_red, 0.0, i2Q_ref_freeze + Delta_i2Q)), i2Q_ref)));

end FRT_Pre-Fault_Voltage;

